/*Table structure for table `distributor_authority_info` */

CREATE TABLE `distributor_authority_info` (
  `res_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '企业权id(即资源id)',
  `res_name` varchar(32) DEFAULT NULL COMMENT '权限名称',
  `res_code` varchar(32) DEFAULT NULL COMMENT '资源编码,或者权限编码',
  `res_url` varchar(128) DEFAULT NULL COMMENT '权限url(资源url)',
  `logic_url` varchar(128) DEFAULT NULL COMMENT '重新修改后的权限url,避免和之前冲突,显示口碑行左边菜单逻辑',
  `res_order` int(11) DEFAULT NULL COMMENT '排序',
  `data_access` varchar(32) DEFAULT NULL COMMENT '显示的图标,后台可设置',
  `parent_id` int(11) DEFAULT NULL COMMENT '父节点id',
  `level` int(11) DEFAULT NULL COMMENT '层次',
  `logic_parent_id` int(11) DEFAULT NULL COMMENT '重新添加的父节点Id,为了避免和之前冲突,显示口碑行左边菜单逻辑',
  `logic_level` int(11) DEFAULT NULL COMMENT '重新添加的层次，为了避免和之前的冲突,显示口碑行左边菜单逻辑',
  `logic_show` varchar(32) DEFAULT NULL COMMENT '重新添加的是否显示该菜单，主要用来隐藏之前业务中不需要的菜单名称,显示口碑行左边菜单逻辑',
  `res_type` varchar(32) DEFAULT NULL COMMENT '权限(资源)类型',
  `style_img` varchar(64) DEFAULT NULL COMMENT '重新添加的图标字段，之前使用的是class，这里用来保存相对位置的img,口碑行统一左边菜单',
  `style_type` varchar(32) DEFAULT NULL COMMENT '样式类型,其实data_access也有样式的逻辑,通过这个字段逻辑更清晰',
  `is_load_page` varchar(16) DEFAULT NULL COMMENT '是否load整个页面,Y表示跳转到一个页面;其他情况就是局部刷新,将结果即html内容,放content',
  `is_relation_brand` varchar(1) DEFAULT NULL COMMENT '权限是否与品牌关联',
  `auth_level1` int(11) DEFAULT NULL COMMENT '用户级别为1的用户所拥有的权限,即普通会员有的权限,为1表示拥有权限,为0或者空表示没有',
  `auth_level2` int(11) DEFAULT NULL COMMENT '用户级别为2的用户所拥有的权限,即专业会员有的权限,为1表示拥有权限,为0或者空表示没有',
  `auth_level3` int(11) DEFAULT NULL COMMENT '用户级别为3的用户所拥有的权限,即高级会员有的权限,为1表示拥有权限,为0或者空表示没有',
  `auth_level4` int(11) DEFAULT NULL COMMENT '用户级别为4的用户所拥有的权限,即VIP会员有的权限,为1表示拥有权限,为0或者空表示没有',
  `is_authority_menu` varchar(1) DEFAULT NULL COMMENT '是否为权限管理菜单,如果是权限管理菜单,其值为Y,其他情况则表示不是权限管理菜单,如空或者N,因为业务上需要根据这个值进行判断,点击权限管理菜单时,和后台交互',
  PRIMARY KEY (`res_id`)
) ENGINE=InnoDB AUTO_INCREMENT=38 DEFAULT CHARSET=utf8 COMMENT='经销商权限信息表,即经销商资源表,权限即资源';

