  `pic2` varchar(128) COLLATE utf8_bin DEFAULT NULL COMMENT '门店实景照片2',
  `pic3` varchar(128) COLLATE utf8_bin DEFAULT NULL COMMENT '门店实景照片3',
  `pic4` varchar(128) COLLATE utf8_bin DEFAULT NULL COMMENT '门店实景照片4',
  `pic5` varchar(128) COLLATE utf8_bin DEFAULT NULL COMMENT '门店实景照片5',
  `pic6` varchar(128) COLLATE utf8_bin DEFAULT NULL COMMENT '门店实景照片6',
  `store_card_pic1` varchar(128) COLLATE utf8_bin DEFAULT NULL COMMENT '门店名片图片1',
  `shopowner_id` int(11) DEFAULT NULL COMMENT '店长id',
  `shop_jjrappqrcode_url` varchar(128) COLLATE utf8_bin DEFAULT NULL COMMENT '家聚日小程序微店铺页二维码地址,扫码后直接进入家聚日小程序微店铺页,可以带店铺参数',
  `opening_state` int(11) DEFAULT NULL COMMENT '开业状态:1表示开业,0停业',
