/*Table structure for table `store_login_user` */

CREATE TABLE `store_login_user` (
  `store_user_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键,登录用户主键ID',
  `distributor_id` int(11) DEFAULT NULL COMMENT '经销商id,外键',
  `store_id` int(11) DEFAULT NULL COMMENT '所属门店ID,外键',
  `login_phone` varchar(32) COLLATE utf8_bin DEFAULT NULL COMMENT '登陆手机',
  `user_password` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '登录密码',
  `nick_name` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '昵称',
  `full_name` varchar(32) COLLATE utf8_bin DEFAULT NULL COMMENT '姓名',
  `personal_image` varchar(512) COLLATE utf8_bin DEFAULT NULL COMMENT '个人图像',
  `business_card` varchar(128) COLLATE utf8_bin DEFAULT NULL COMMENT '店员用户名片',
  `user_type` int(11) DEFAULT NULL COMMENT '用户类型,1经销商管理员;2表示普通店员',
  `weChat_openid` varchar(128) COLLATE utf8_bin DEFAULT NULL COMMENT '微信openid',
  `weChat_app_openid` varchar(128) COLLATE utf8_bin DEFAULT NULL COMMENT '用户在微信小程序下的openid,有一定作用',
  `weChat_unionid` varchar(128) COLLATE utf8_bin DEFAULT NULL COMMENT '微信unionId,用于一个开放平台下的多个公众号的唯一验证',
  `regist_status` int(11) DEFAULT NULL COMMENT '注册状态,即注册的步骤,1表示收到验证码,点了一下步;2表示提交了总店信息;3表示提交了经销商信息',
  `total_integral` int(11) DEFAULT NULL COMMENT '店员总积分',
  `exchange_integral` int(11) DEFAULT NULL COMMENT '已兑换积分,即已经使用的积分,已经换成钱了',
  `not_exchange_integral` int(11) DEFAULT NULL COMMENT '未兑换的积分,表示还没有使用的积分,还可以兑换成钱',
  `account_balance` decimal(12,2) DEFAULT NULL COMMENT '账户余额,即店员账户余额',
  `lastmonth_income` decimal(12,2) DEFAULT NULL COMMENT '上月收入',
  `contact_jjrappqrcode_url` varchar(128) COLLATE utf8_bin DEFAULT NULL COMMENT '店员接洽家聚日客户的家聚日小程序二维码,扫码这个二维码直接进入家聚日小程序的购物车',
  `inviteregist_storeappqrcode_url` varchar(128) COLLATE utf8_bin DEFAULT NULL COMMENT '邀请店员注册的二维码,扫码这个二维码后,进入品店通小程序的店员注册页面',
  `business_card_qrcodeurl` varchar(128) COLLATE utf8_bin DEFAULT NULL COMMENT '店员口碑名片二维码url,扫码后进入家聚日小程序口碑名片',
  `account_type` int(11) DEFAULT NULL COMMENT '账号类型,1表示试用账户,2表示正式账户,试用账户,看注册时间有没有超过一个月,正式账户,看当前时间有没有超过合同结束时间',
  `regist_time` datetime DEFAULT NULL COMMENT '注册时间',
  `account_assets` decimal(12,2) DEFAULT NULL COMMENT '账户资产',
  `cash_withdrawal_money` decimal(12,2) DEFAULT NULL COMMENT '可提现金额',
  `weChat_number` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '微信号',
  `store_type` int(11) DEFAULT NULL COMMENT '店员所属门店类型:1加盟店,2直营店',
  `is_binding` varchar(1) COLLATE utf8_bin DEFAULT NULL COMMENT '是否绑定,即手机号码和微信号是否绑定,Y表示已经绑定,N或者空表示未绑定',
  `invite_seller_userId` int(11) DEFAULT NULL COMMENT '邀请商户入驻的家聚日用户id,因为有的商户入驻是通过客户引入的',
  `is_delete` int(11) DEFAULT NULL COMMENT '是否删除,逻辑删除标志,1表示已删除,0表示未删除',
  `version_id` int(11) DEFAULT '0' COMMENT '版本id号,辅助字段,乐观锁需要用到,防止对同一行的并发修改',
  PRIMARY KEY (`store_user_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='品店通用户登录表,含经销商管理员和普通店员,都在这个表里';

/*Data for the table `store_login_user` */

/*Table structure for table `sys_login_user` */

CREATE TABLE `sys_login_user` (
