  `user_password` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '登录密码',
  `session_key` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT 'SessionKey',
  `nick_name` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '昵称',
  `personal_image` varchar(512) COLLATE utf8_bin DEFAULT NULL COMMENT '个人图像',
  `weChat_account` varchar(32) COLLATE utf8_bin DEFAULT NULL COMMENT '微信号',
  `weChat_openid` varchar(128) COLLATE utf8_bin DEFAULT NULL COMMENT '微信openid,有一定作用',
  `weChat_app_openid` varchar(128) COLLATE utf8_bin DEFAULT NULL COMMENT '用户在微信小程序下的openid,有一定作用',
  `customer_name` varchar(32) COLLATE utf8_bin DEFAULT NULL COMMENT '客户姓名',
  `weChat_unionid` varchar(128) COLLATE utf8_bin DEFAULT NULL COMMENT '微信unionId,用于一个开放平台下的多个公众号的唯一验证',
  `QQ` varchar(32) COLLATE utf8_bin DEFAULT NULL COMMENT 'QQ号',
  `microblog_account` varchar(32) COLLATE utf8_bin DEFAULT NULL COMMENT '微博账号',
  `douban_account` varchar(32) COLLATE utf8_bin DEFAULT NULL COMMENT '豆瓣账号',
  `user_type` int(11) DEFAULT NULL COMMENT '用户类型,是专业用户,业务主,还是企业(工厂),1表示设计师/专业人士;2表示业主;3表示工厂',
  `visiting_number` int(11) DEFAULT NULL COMMENT '到访数',
  `fans_number` int(11) DEFAULT NULL COMMENT '粉丝数,这个字段根据实际情况来使用,也可以不用',
