  PRIMARY KEY (`user_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='系统登录用户表,里面存放所有登录该系统或者平台的账号和密码信息,可以有不同类型的用户登录';

